description:
A rare astronomical event causes a permanent worldwide black out, forcing residents of a middle-class suburb to get by with no modern conveniences. The community pulls together and adapts to a simpler way of life, but their success draws the attention of the less resourceful residents in the area and soon results in a war between subdivisions. This is their story.

